comment: |-
  SELECT T2.transcript_date,
         T1.transcript_id
  FROM Transcript_Contents AS T1
  JOIN Transcripts AS T2 ON T1.transcript_id = T2.transcript_id
  GROUP BY T1.transcript_id
  HAVING count(*) >= 2

